Text:
Interview Question:

Q) Why Array index starts from zero?

Ans:

When we try to access an element from Array then internally it uses this formula

Base Address + Index*Size Of(Datatype);

Suppose Array index starts from one and base address of

the array is 100 then

e.g.

int[] arr={7, 3, 5, 6};

Address: 100 104 108 112

So when we try to access the first element then it acts

like,

100+ 1*sizeof(int);

100+ 4;

104;

Thus, we cannot access the first element in the array if the Array index starts from 1. Thats why Array index starts from 0. "

